'use strict';
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
//@@DocInclude
//@@DocBrief("Provides access to messages sent from the server to the client")
class ClientMessage {
    messageId;
    dateTime;
    from;
    messageType;
    feature;
    text;
    subject;
    constructor() {
        this.messageId = "";
        this.dateTime = stdlib.mkdate(2000, 1, 1);
        this.from = "";
        this.messageType = "";
        this.feature = "";
        this.text = "";
        this.subject = "";
    }
    getMessageId() {
        return this.messageId;
    }
    getDateTime() {
        return this.dateTime;
    }
    getFrom() {
        return this.from;
    }
    getMessageType() {
        return this.messageType;
    }
    getFeature() {
        return this.feature;
    }
    getText() {
        return this.text;
    }
    getSubject() {
        return this.subject;
    }
}
module.exports = ClientMessage
